import axios from "axios";

const API_URL = "http://localhost:8080/api/auth/signup";

class UserService {
  signup(username, email, password, phoneNumber, address) {
    return axios.post(API_URL, {
      username,
      email,
      password,
      phoneNumber,
      address,
    });
  }
}

export default new UserService();
